import React from "react"

function List(props){
    console.log("List - driver Information", props.driverList)
    const makeDriverList = props.driverList.map((obj, index) => {
        return (
            <li key={index}>{obj.name} {obj.address}</li>
        )
    })
    return(
        <div style={{ height: `90vh`, width: '100%' }}>
            <h2>List Page</h2>
            <h4>Drivers</h4>
            <ul>
                {makeDriverList}
            </ul>
        </div>

    )
}
export default List
